INSERT INTO `a_empresa` (`codigo`, `texto`) VALUES
(0, 'HISTÓRIA <br> <br>\r\n\r\nO Grupo Allcred Serviços de Intermediação Financeira Ltda, iniciou suas atividades na cidade de Franca/ SP no dia 01 de novembro de 2006, pelo empreendedor Alessandro Mendes  que começou a efetuar empréstimos e refinanciamentos para aposentados e pensionistas do INSS,através de parceria com alguns bancos, buscando sempre uma taxa de juros diferenciada, a fim de melhor atender as necessidades dos clientes. A empresa foi logo alcançando seus resultados: passou a ter as melhores taxas do mercado, somado a um atendimento ímpar. A partir disto, pôde ampliar suas instalações, aumentar seu quadro de colaboradores e oferecer mais serviços à comunidade.<br>\r\nAtualmente, a Allcred conta com a Matriz e mais onze agências, sendo uma na cidade de Patrocínio Paulista/ SP, uma em Morro Agudo/ SP , Sao Joaquim da Barra Franca, Ituverava, Igarapava, Cruzeiro,Orlandia. oferecendo os seguintes serviços:<br> \r\n<br>• Empréstimos e refinanciamentos para aposentados, pensionistas, servidores municipais, estaduais e federais, funcionários do Exército, Aeronáutica e Correios;\r\n<br>• Compra de dívida de TODOS os bancos, inclusive cartão de crédito consignado (INSS);\r\n<br>• Financiamento e refinanciamento de veículos;\r\n<br>• Convênio com empresas privadas.<br>\r\n<br> A Allcred conta hoje com uma equipe de cinquenta colaboradores que buscam constantemente aprimorar suas habilidades e conhecimentos a fim de obter melhores resultados no mercado financeiro.<br> <br>\r\n\r\nMISSÃO <br> <br>\r\n\r\nA partir de um atendimento de excelência, proporcionar a todos os nossos clientes uma taxa de juros diferenciada e que atenda às suas necessidades. <br> <br>\r\n\r\nVALORES <br> <br>\r\n\r\n• Excelência no atendimento ao cliente e aos fornecedores;\r\n<br>• Transparência em todas as ações;\r\n<br>• Respeito, companheirismo e profissionalismo sempre. <br> <br>\r\n\r\nOBJETIVOS <br> <br>\r\n\r\n• Ser um grupo focado em resultados, com as melhores taxas do mercado;\r\n<br>• Ser referência no mercado de intermediação financeira;\r\n<br>• Buscar inovações sempre.\r\n');
